import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import form from "./Pages/form";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" exact component={form} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
